function AboutMe() {
  return (
    <div className=" text-darkTone">
      Hello! I'm Danial Ross I'm recent graduate with a Bachelor's degree in
      Computer Science from Carleton University, passionately aspiring to become
      a Full Stack Developer. During my academic journey, I have immersed myself
      in mastering core web technologies including JavaScript, HTML, CSS,
      alongside gaining hands-on experience with Node.js and React to build
      dynamic, user-centric web applications. Although I'm at the outset of my
      professional career, my solid foundation in coding, problem-solving
      skills, and a keen interest in both front-end and back-end development
      have prepared me well to contribute effectively in roles such as Frontend,
      Backend, and Full Stack Developer. I'm eager to leverage my knowledge and
      skills in a dynamic environment that offers opportunities for growth and
      allows me to make significant contributions to the development team.
    </div>
  );
}

export default AboutMe;
